import React from "react";
import Form from "./Form";

function Page({url}){
    this.url = "";

    return (
        <div className="m-6">
            <h1 className="text-3xl font-bold text-teal-600"> Webcrawler </h1>
            <Form url={this.url} />
            {this.url}
        </div>
    );
}

export default Page
